 * @param container
 * @param pt
 * @return
 * @throws DelaunayError 
 */
private DEdge insertInTriangleRevertible(DTriangle container,DPoint pt) throws DelaunayError {
  LinkedList<DEdge> badEdges=new LinkedList<DEdge>();
  Deque<DEdge> swapMem=new LinkedList<DEdge>();
