      for (int i=0; i < mInput.getPointerCount() && index < mPoints.length; i++) {
        if (mInput.getPointerId(i) == id) {
          mPoints[index].x=(int)(mInput.getX(i) * xRatio);
          mPoints[index].y=(int)(mInput.getY(i) * yRatio);
          index++;
          break;
        }
      }
    }
    return mPoints;
  }
